/**
 * File: PlayerDetail.js
 * Version: v1.3 - Fixed
 * Created by: K. Zimmerman
 * Project: kc_royals_backend
 * Description:
 * - Displays detailed player statistics including batting and pitching data.
 * - Fixes missing fields, syntax errors, and improves error handling.
 * - Ensures correct parsing of nested statistics.
 */

import React, { useEffect, useState } from "react";
import { fetchPlayerDetails } from "../api/api";

const PlayerDetail = ({ playerId }) => {
  const [player, setPlayer] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!playerId) return;

    fetchPlayerDetails(playerId)
      .then((data) => {
        if (!data) {
          setError("Player not found.");
          return;
        }
        setPlayer(data);
      })
      .catch((err) => {
        console.error("Error fetching player details:", err);
        setError("Error retrieving player details.");
      });
  }, [playerId]);

  if (error) return <p className="text-danger">{error}</p>;
  if (!player) return <p>Loading...</p>;

  return (
    <div className="container mt-4">
      <h2>
        {player.name_first} {player.name_last}
      </h2>
      <p>
        <strong>Team:</strong> {player.team}
      </p>
      <p>
        <strong>Position:</strong> {player.primary_position || "N/A"}
      </p>
      <p>
        <strong>Birth Date:</strong> {player.birth_date}
      </p>
      <p>
        <strong>Height:</strong>{" "}
        {player.height_feet ? `${player.height_feet} ft` : "N/A"}
      </p>
      <p>
        <strong>Weight:</strong> {player.weight} lbs
      </p>
      <p>
        <strong>Throws:</strong> {player.throws}
      </p>
      <p>
        <strong>Bats:</strong> {player.bats}
      </p>

      {/* Batting Stats */}
      {player.stats?.batting?.length > 0 && (
        <div>
          <h3>Batting Statistics</h3>
          {player.stats.batting.map((stat, index) => (
            <div key={index} className="stat-box">
              <p>
                <strong>Year:</strong> {stat.year} | <strong>League:</strong>{" "}
                {stat.league || "N/A"} | <strong>Team:</strong>{" "}
                {stat.org_abbreviation}
              </p>
              <p>
                <strong>Games:</strong> {stat.games} | <strong>At Bats:</strong>{" "}
                {stat.at_bats} | <strong>Hits:</strong> {stat.hits}
              </p>
              <p>
                <strong>Home Runs:</strong> {stat.home_runs} |{" "}
                <strong>Runs:</strong> {stat.runs} |{" "}
                <strong>Strikeouts:</strong> {stat.strikeouts}
              </p>
              <p>
                <strong>Stolen Bases:</strong> {stat.stolen_bases} |{" "}
                <strong>Walks:</strong> {stat.bases_on_balls}
              </p>
            </div>
          ))}
        </div>
      )}

      {/* Pitching Stats */}
      {player.stats?.pitching?.length > 0 && (
        <div>
          <h3>Pitching Statistics</h3>
          {player.stats.pitching.map((stat, index) => (
            <div key={index} className="stat-box">
              <p>
                <strong>Year:</strong> {stat.year} | <strong>League:</strong>{" "}
                {stat.league || "N/A"} | <strong>Team:</strong>{" "}
                {stat.org_abbreviation}
              </p>
              <p>
                <strong>Games:</strong> {stat.games} |{" "}
                <strong>Innings Pitched:</strong> {stat.innings_pitched}
              </p>
              <p>
                <strong>Wins:</strong> {stat.wins} | <strong>Losses:</strong>{" "}
                {stat.losses} | <strong>Saves:</strong> {stat.saves}
              </p>
              <p>
                <strong>Strikeouts:</strong> {stat.strikeouts} |{" "}
                <strong>Walks:</strong> {stat.bases_on_balls}
              </p>
              <p>
                <strong>Home Runs Allowed:</strong> {stat.home_runs} |{" "}
                <strong>Earned Runs:</strong> {stat.hits}
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default PlayerDetail;
